import React, { useEffect, useState } from 'react';

function UserList() {
  const [users, setUsers] = useState([]);
  const [search, setSearch] = useState('');
  const [newUser, setNewUser] = useState({
    name: '',
    email: '',
    phone: '',
    company: { name: '' },
    address: { suite: '', street: '', city: '', zipcode: '' },
  });

  // Load users from localStorage when the component mounts
  useEffect(() => {
    const storedUsers = localStorage.getItem('users');
    if (storedUsers) {
      setUsers(JSON.parse(storedUsers));
    }
  }, []);

  // Save users to localStorage whenever users state changes
  useEffect(() => {
    console.log('Saving users to localStorage:', users); // <-- Debug log here
    localStorage.setItem('users', JSON.stringify(users));
  }, [users]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;

    if (name.startsWith('address.')) {
      const field = name.split('.')[1];
      setNewUser((prev) => ({
        ...prev,
        address: {
          ...prev.address,
          [field]: value,
        },
      }));
    } else if (name === 'company.name') {
      setNewUser((prev) => ({
        ...prev,
        company: { name: value },
      }));
    } else {
      setNewUser((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleAddUser = (e) => {
    e.preventDefault();

    const id = users.length + 1;
    const userToAdd = { ...newUser, id };

    setUsers((prevUsers) => [...prevUsers, userToAdd]);

    // Reset form
    setNewUser({
      name: '',
      email: '',
      phone: '',
      company: { name: '' },
      address: { suite: '', street: '', city: '', zipcode: '' },
    });
  };

  const filteredUsers = users.filter((user) =>
    user.name.toLowerCase().includes(search.toLowerCase()) ||
    user.email.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div style={{ padding: '20px' }}>
      <h1>User Directory</h1>

      <form onSubmit={handleAddUser} style={{ marginBottom: '20px' }}>
        <h2>Add New User</h2>
        <input
          name="name"
          value={newUser.name}
          onChange={handleInputChange}
          placeholder="Name"
          required
        />
        <input
          name="email"
          value={newUser.email}
          onChange={handleInputChange}
          placeholder="Email"
          required
        />
        <input
          name="phone"
          value={newUser.phone}
          onChange={handleInputChange}
          placeholder="Phone"
          required
        />
        <input
          name="company.name"
          value={newUser.company.name}
          onChange={handleInputChange}
          placeholder="Company"
          required
        />
        <input
          name="address.suite"
          value={newUser.address.suite}
          onChange={handleInputChange}
          placeholder="Suite"
        />
        <input
          name="address.street"
          value={newUser.address.street}
          onChange={handleInputChange}
          placeholder="Street"
        />
        <input
          name="address.city"
          value={newUser.address.city}
          onChange={handleInputChange}
          placeholder="City"
        />
        <input
          name="address.zipcode"
          value={newUser.address.zipcode}
          onChange={handleInputChange}
          placeholder="Zipcode"
        />
        <button type="submit" style={{ display: 'block', marginTop: '10px' }}>
          Add User
        </button>
      </form>

      <input
        type="text"
        placeholder="Search users..."
        value={search}
        onChange={(e) => setSearch(e.target.value)}
        style={{ padding: '8px', marginBottom: '16px', width: '100%' }}
      />

      <ul>
        {filteredUsers.map((user) => (
          <li key={user.id} style={{ marginBottom: '20px' }}>
            <strong>{user.name}</strong>
            <br />
            Email: {user.email}
            <br />
            Phone: {user.phone}
            <br />
            <br />
            Company: {user.company.name}
            <br />
            <div>
              Address: {user.address.suite}
              <span style={{ margin: '0 8px' }}>|</span>
              {user.address.street}
              <span style={{ margin: '0 8px' }}>|</span>
              {user.address.city}
              <span style={{ margin: '0 8px' }}>|</span>
              {user.address.zipcode}
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default UserList;
